  `id` int(11) NOT NULL AUTO_INCREMENT,
  `biometric_id` int(11) NOT NULL,
  `dtr_date` date NOT NULL,
  `time_in` varchar(5) DEFAULT NULL,
  `time_out` varchar(5) DEFAULT NULL,
  `late` int(11) DEFAULT '0',
  `late_eq` decimal(18,2) DEFAULT '0.00',
  `under_time` decimal(18,2) DEFAULT '0.00',
  `over_time` decimal(18,2) DEFAULT '0.00',
  `night_diff` decimal(18,2) DEFAULT '0.00',
  `schedule_id` int(11) DEFAULT '0',
  `ndays` int(11) DEFAULT '0',
  `lh_ot` decimal(18,2) DEFAULT '0.00',
  `lhot_rd` decimal(18,2) DEFAULT '0.00',
  `sh_ot` decimal(18,2) DEFAULT '0.00',
  `shot_rd` decimal(18,2) DEFAULT '0.00',
  `sun_ot` decimal(18,2) DEFAULT '0.00',
  PRIMARY KEY (`biometric_id`,`dtr_date`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8953 DEFAULT CHARSET=utf8mb4;

